import React from 'react';
import style from './TripList.module.css';
import tripListData from './TripListData.js'

import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';



export default function CenteredGrid() {
  const classes = useStyles();

  return (   
    <>
    {tripListData.map(item => (
       <div className={classes.root}>
         <Grid container spacing={1} className={style.mainGridContainer}>
            <Grid item xs={12} sm={6}>
              <Paper className={classes.paper}>{item.name}</Paper>
            </Grid>
            <Grid item xs={12} sm={6} className={style.grid}>
              <Paper className={classes.paper} >
                <p>{item.numberOfPeople}</p>
                <p>{item.seasonTime} </p>
                <p>{item.price} </p>
              </Paper>
            </Grid>
          </Grid>
        </div>
    ))} 
  </>  
  );
}
